import React from 'react';
import './content_signup.css';
import Button from '../../../general/button/button'


class ContentSignUp extends React.Component{
  constructor(props){
    super(props);

    this.state = {
              Regular: true
         }
  }
  changeText(){
        this.setState({Regular: !this.state.Regular})
    }
  render(){
       let text = this.state.Regular ? "Regular Customer" : "Business Customer";
    return(
      <div className="container" id="SignupContent">
         <p className="text-center">Fill in your personal details</p>
         <div className="col-6 text-center">
         <button onClick={this.changeText.bind(this)}
         type="button" data-toggle="collapse" data-target=".multi-collapse" aria-controls="multiCollapseExample1 multiCollapseExample2">
                   {text}
           </button>
              {this.props.data.RegDetails.map((items)=>{
              return(
                 <form action="/action_page.php">
                  <div className="collapse show multi-collapse" id="multiCollapseExample1">
                      <div className={items.classN}>
                        <label for={items.for} class={items.labelC}>{items.name}</label>
                        <input className={items.inputC} type={items.type} placeholder={items.placeholder} required/>
                      </div>
                      </div>
                      <Button type="btn" name="Submit"/>
                    </form>
              )})}

          </div>
          <div className="col-6 text-center">
            <span>Business Customer</span>
            <form action="/action_page.php">
              {this.props.data.BusDetails.map((items)=>{
                return(
                    <div class="collapse multi-collapse" id="multiCollapseExample2">
                    <div className={items.classN}>
                      <label for={items.for} class={items.labelC}>{items.name}</label>
                      <input className={items.inputC} type={items.type} placeholder={items.placeholder} required/>
                    </div>
                    </div>
                  )})}
                <Button type="btn" name="Submit"/>
              </form>
          </div>
      </div>
      )
  }
}
export default ContentSignUp
